import React from "react";

function Navbar(){
   return(
    <div >
    <div className="navbar">
        <ul>
            <li >Home </li>
            <li>About Us </li>
            <li>Admissions </li>
            <li>Learning </li>
            <li>Our Campus </li>
            <li>Contact Us </li>
        </ul>
        </div>
    </div>
   );
}

export default Navbar
